import React from 'react';
import {getData} from'../data/workers';



export const Worker = (props) => {
    const { worker } = useParams();
    return <div >
        name: {getData(worker).name}
        phone: {getData(worker).phone}
        address: {getData(worker).address}
    </div>;
}
